import React from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";
import gold_1 from "../../images/gold_1.png"
const Summoner = (props, context) => (
  <div className={styles.summoner}>
      <div className={styles.box}>
        <div className={styles.top}>
          <div className={styles.left} >
            <img
                src={gold_1}
                alt={"Logo"}
                className={styles.logo}/>
          </div>
          <div className={styles.right} >
            <div className={styles.name}>김동휘</div>
            <div className={styles.tier}>GOLD 4 70KP</div>
            <div className={styles.buttons}>

            
            
            </div>
           
          </div>
          </div>
          <div className={styles.bottom}>
            <div className={styles.toptext}>
              오늘 이 소환사를 총 1명의 사람이 검색했습니다. 
            </div>
            <div className={styles.bottomtext}>
              이 소환사는 현재까지 총 1명의 사람이 검색했습니다. 
            </div>
          </div>
      </div>
  </div>
);

Summoner.propTypes = {
  loading : PropTypes.bool.isRequired,
};

export default Summoner;
